The Football League Show 03.08.2013 

Duration: 1 hour, 20 minutes 

After a short summer break the beautiful game is back - nine months of drama, unpredictability and the thrill of open title races in-store across all three leagues.

And as the Football League celebrates its 125th anniversary, QPR, adjusting to life back in the Championship, kick off the new season at home to Sheffield Wednesday. There is also extended highlights of a classic Lancashire derby as founding members Burnley go head to head with Bolton at Turf Moor, and from League One action from Sheffield United's meeting with Notts County. All the best of the Football League brought to you by Manish Bhasin.
